import React from 'react';
import Movielist from './watchlist' 

class Navigate extends React.Component {

    addwatchlist() {
        return <Movielist/>
    }

    render() {
        return(
            <div>
                            <Movielist/>

                 <button onClick={this.addwatchlist.bind(this)}>change</button>
                <button>Save</button>
            </div>
        )
    }
}

export default Navigate
